function CountryInfo(props){
    //let ratio = 1
    const mystyle = {
        color: "white",
        backgroundColor: "DodgerBlue",
      };

    return (

    <>
    <div>

        {
        //.filter(props.data => props.data.common.name = "Antarctica")

        props.data.map((country) =>

            <div key={country.cca3} ratio={(country.area/props.data[0].area * 100 + "%")} className="countryInfo">

                <p className="countryName">{country.name.common} {country.area} KM <sup>2</sup></p>


                <div style={{width: this.ratio, height: "10px", backgroundColor: "Blue", visibility: "visible"}}></div>

            </div>
        )
        }

    </div>

    </>

    )
}



export default CountryInfo;
